import React from 'react'
import './Navigation.css'

const Navigation = ({RouteChange})=>{
	return(
		<div className="nav_bar">
			<nav>
			 	<p className='pointer f4 link black' onClick={RouteChange('sign_out')}> 
			 		Sign Out
			 	</p>
			 </nav>
		</div>
	)
}

export default Navigation;
